        margin: "23px",
    }
    const trTd = {
        padding: "15px"
    }

    const localData = useSelector((state) => {
        console.log(state);
    })
   
    return <Table style={style} striped bordered hover variant="dark">
        <thead>
            <tr>
                <th>Name</th>
                <th>Profile</th>
                <th>Phone</th>
                <th>Action</th>
            </tr>
        </thead>
        <tbody>
            {localData.tabaleData.length ? <></> :  <tr>
                <td>Junaid</td>
                <td>Dev</td>
                <td>99999</td>
                <td><button>Delete</button></td>
            </tr>}
           

        </tbody>
    </Table>
}
